  \"Distribution, late summer feeding habits, and effects of dam building on stream
  width and depth by beaver (Castor canadensis) at Walnut Creek National Wildlife
  Refuge\",\n\t\"tracking_summary\": {\n\t\t\"total\": 8,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
