  \"distribution-late-summer-feeding-habits-and-effects-of-dam-building-on-stream-width-and-de\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a study done on
  beaver dam locations at Neal Smith National Wildlife Refuge (formerly Walnut Creek
  National Wildlife Refuge).  The refuge is working to restore beaver communities,
  and because beaver have a large impact on their environment, itu2019s important
  to know, and be able to predict, which sites are preferable to beavers for building
  dams.  In this study, beaver dams were located and the depth and width were measured
  at 5, 10, and 20 foot intervals above and below the dam.  The results showed that
  stream depth and width were similar for all three dam sites.  The average stream
  depth above the dams was 46.778 centimeters and the average width was 482.222 centimeters.
  The average stream depth below the dams was 28.667 and the average width was 431.111.\",\n\t\"license_title\":
